import React from 'react';
import { Nav, NavDropdown } from 'react-bootstrap';

const CategoryMenu = () => {
 return (
    <Nav className="category-menu">
      <NavDropdown title="Electronics" id="electronics-menu">
        <NavDropdown.Item href="#subcategory">Subcategory</NavDropdown.Item>
      </NavDropdown>

      <NavDropdown title="Men" id="men-menu">
        <NavDropdown.Item href="#subcategory">Subcategory</NavDropdown.Item>
      </NavDropdown>

      <NavDropdown title="Women" id="women-menu">
        <NavDropdown.Item href="#subcategory">Subcategory</NavDropdown.Item>
      </NavDropdown>
    </Nav>
 );
};

export default CategoryMenu;
